import React, { Component } from "react"
import {
  OverviewWrapper,
  OverviewTitle,
  OverviewParagraph,
} from "./styles/style"

class Overview extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    return (
      <>
        <OverviewWrapper>
          <OverviewTitle>Overview</OverviewTitle>
          <OverviewParagraph>
            Start in New Orleans and end in New York City! With the discovery
            tour Eastern Discovery (Start New Orleans), you have a 14 day tour
            package taking you from New Orleans to New York City and through New
            Orleans, USA and 14 other destinations in USA. Eastern Discovery
            (Start New Orleans) includes accommodation in a hotel as well as an
            expert guide, meals, transport and more.
          </OverviewParagraph>
        </OverviewWrapper>
      </>
    )
  }
}

export default Overview
